    private Owner Owner { get; set; } = new Owner();

    public string Title { get; set; } = "New Customer";
    public string ButtonText { get; set; } = "Create";
    public string ButtonType { get; set; } = "btn-success";

    [CascadingParameter]
    public int Id { get; set; }

    protected async override Task OnInitializedAsync()
    {

        if (Id != 0)
        {
            ButtonText = "Update";
            ButtonType = "btn-warning";
            Owner = await OwnerRepository.FindAsync(Id);
        }
        else
        {

        }
    }

    async Task HandleValidSubmit()
    {
        if (Id != 0)
        {
            await OwnerRepository.UpdateAsync(Owner);
        }
        else
        {
            await OwnerRepository.AddAsync(Owner);
        }
    }

